    def __gen_freq_count(self):
        colnames = ['Id']
        colnames += ['FR_' + hex(i)[2:] for i in range(16 ** 2)]

        consolidation = []
        twoByte = [0] * 16 ** 2
        for row in self.bytes_list:
            codes = row[:-2].split()[1:]

            # Conversion of code to to two byte
            twoByteCode = [int(i, 16) for i in codes if i != '??' and i != '?']
            # Frequency calculation of two byte codes
            for i in twoByteCode:
                twoByte[i] += 1

        # Row added
        consolidation += [self.file_name]
        consolidation += twoByte

        return pd.DataFrame([consolidation], columns=colnames)

    def __gen_img(self):
        header = ['Id'] + ['bytes_%i' % x for x in range(1000)]
        data = [self.file_name] + image_fea.read_image(self.file_name)

        return pd.DataFrame([data], columns=header)

